    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <style type="text/css">
.panelset {
width: 100%;
position: relative;
--panel-tabs-border-bottom: #ddd;
--panel-tabs-sideways-max-width: 25%;
--panel-tab-foreground: currentColor;
--panel-tab-background: unset;
--panel-tab-active-foreground: currentColor;
--panel-tab-active-background: unset;
--panel-tab-hover-foreground: currentColor;
--panel-tab-hover-background: unset;
--panel-tab-active-border-color: currentColor;
--panel-tab-hover-border-color: currentColor;
--panel-tab-inactive-opacity: 0.5;
--panel-tab-font-family: inherit;
}
.panelset * {
box-sizing: border-box;
}
.panelset .panel-tabs {
display: -webkit-box;
display: flex;
flex-wrap: wrap;
-webkit-box-orient: horizontal;
-webkit-box-direction: normal;
flex-direction: row;
-webkit-box-pack: start;
justify-content: start;
-webkit-box-align: center;
align-items: center;
overflow-y: visible;
overflow-x: auto;
-webkit-overflow-scrolling: touch;
padding: 0 0 2px 0;
box-shadow: inset 0 -2px 0px var(--panel-tabs-border-bottom);
}
.panelset .panel-tabs * {
-webkit-transition: opacity 0.5s ease;
transition: opacity 0.5s ease;
}
.panelset .panel-tabs .panel-tab {
min-height: 50px;
display: -webkit-box;
display: flex;
-webkit-box-pack: center;
justify-content: center;
-webkit-box-align: center;
align-items: center;
padding: 0.5em 1em;
font-family: var(--panel-tab-font-family);
opacity: var(--panel-tab-inactive-opacity);
border-top: 2px solid transparent;
border-bottom: 2px solid transparent;
margin-bottom: -2px;
color: var(--panel-tab-foreground);
background-color: var(--panel-tab-background);
list-style: none;
z-index: 5;
}
.panelset .panel-tabs .panel-tab > a {
color: currentColor;
text-decoration: none;
border: none;
width: 100%;
height: 100%;
}
.panelset .panel-tabs .panel-tab > a:focus {
outline: none;
text-decoration: none;
border: none;
}
.panelset .panel-tabs .panel-tab > a:hover {
text-decoration: none;
border: none;
}
.panelset .panel-tabs .panel-tab:hover {
border-bottom-color: var(--panel-tab-hover-border-color);
color: var(--panel-tab-hover-foreground);
background-color: var(--panel-tab-hover-background);
opacity: 1;
cursor: pointer;
z-index: 10;
}
.panelset .panel-tabs .panel-tab:focus {
outline: none;
color: var(--panel-tab-hover-foreground);
border-bottom-color: var(--panel-tab-hover-border-color);
background-color: var(--panel-tab-hover-background);
}
.panelset .panel-tabs .panel-tab.panel-tab-active {
border-top-color: var(--panel-tab-active-border-color);
color: var(--panel-tab-active-foreground);
background-color: var(--panel-tab-active-background);
opacity: 1;
}
.panelset .panel {
display: none;
}
.panelset .panel-active {
display: block;
}

    <script>/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    [...document.querySelectorAll('.panel-name')]
      .map(el => el.textContent.trim())

    const panelIds = {}

    const uniquePanelId = (name) => {
      name = encodeURIComponent(name.toLowerCase().replace(/[\s]/g, '-'))
      if (Object.keys(panelIds).includes(name)) {
        name += ++panelIds[name]
      } else {
        panelIds[name] = 1
      }
      return name
    }

    const identifyPanelName = (item) => {
      let name = 'Panel'

      // If the item doesn't have a parent element, then we've already processed
      // it, probably because we're in an Rmd, and it's been removed from the DOM
      if (!item.parentElement) {
        return
      }

      // In R Markdown when header-attrs.js is present, we may have found a
      // section header but the class attributes won't be duplicated on the <hX> tag
      if (
        (item.tagName === 'SECTION' || item.classList.contains('section')) &&
        /^H[1-6]/.test(item.children[0].tagName)
      ) {
        name = item.children[0].textContent
        item.classList.remove('panel-name')
        item.removeChild(item.children[0])
        return name
      }

      const nameDiv = item.querySelector('.panel-name')
      if (!nameDiv) return name

      // In remarkjs the .panel-name span might be in a paragraph tag
      // and if the <p> is empty, we'll remove it
      if (
        nameDiv.tagName === 'SPAN' &&
        nameDiv.parentNode.tagName === 'P' &&
        nameDiv.textContent === nameDiv.parentNode.textContent
      ) {
        name = nameDiv.textContent
        item.removeChild(nameDiv.parentNode)
        return name
      }

      // If none of the above, remove the nameDiv and return the name
      name = nameDiv.textContent
      nameDiv.parentNode.removeChild(nameDiv)
      return name
    }

    const processPanelItem = (item) => {
      const name = identifyPanelName(item)
      if (!name) {
        return null
      }
      return { name, content: item.children, id: uniquePanelId(name) }
    }

    const getCurrentPanelFromUrl = (panelset) => {
      const params = new URLSearchParams(window.location.search)
      return params.get(panelset)
    }

    const reflowPanelSet = (panels, idx) => {
      const res = document.createElement('div')
      res.className = 'panelset'
      res.id = 'panelset' + (idx > 0 ? idx : '')
      const panelSelected = getCurrentPanelFromUrl(res.id)

      // create header row
      const headerRow = document.createElement('ul')
      headerRow.className = 'panel-tabs'
      headerRow.setAttribute('role', 'tablist')
      panels
        .map((p, idx) => {
          const panelHeaderItem = document.createElement('li')
          panelHeaderItem.className = 'panel-tab'
          panelHeaderItem.setAttribute('role', 'tab')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          if (thisPanelIsActive) {
            panelHeaderItem.classList.add('panel-tab-active')
            panelHeaderItem.setAttribute('aria-selected', true)
          }
          panelHeaderItem.tabIndex = 0
          panelHeaderItem.id = res.id + '_' + p.id // #panelsetid_panelid

          const panelHeaderLink = document.createElement('a')
          panelHeaderLink.href = '?' + res.id + '=' + p.id + '#' + panelHeaderItem.id
          panelHeaderLink.setAttribute('onclick', 'return false;')
          panelHeaderLink.tabIndex = -1 // list item is tabable, not link
          panelHeaderLink.innerHTML = p.name
          panelHeaderLink.setAttribute('aria-controls', p.id)

          panelHeaderItem.appendChild(panelHeaderLink)
          return panelHeaderItem
        })
        .forEach(el => headerRow.appendChild(el))

      res.appendChild(headerRow)

      panels
        .map((p, idx) => {
          const panelContent = document.createElement('section')
          panelContent.className = 'panel'
          panelContent.setAttribute('role', 'tabpanel')
          const thisPanelIsActive = panelSelected ? panelSelected === p.id : idx === 0
          panelContent.classList.toggle('panel-active', thisPanelIsActive)
          panelContent.id = p.id
          panelContent.setAttribute('aria-labelledby', p.id)
          Array.from(p.content).forEach(el => panelContent.appendChild(el))
          return panelContent

        .forEach(el => res.appendChild(el))

      return res
    }

    /*
     * Update selected panel for panelset or delete panelset from query string
     *
     * @param panelset Panelset ID to update in the search params
     * @param panel Panel ID of selected panel in panelset, or null to delete from search params
     * @param params Current params object, or params from window.location.search
     */
    function updateSearchParams (panelset, panel, params = new URLSearchParams(window.location.search)) {
      if (panel) {
        params.set(panelset, panel)
      } else {
        params.delete(panelset)
      }
      return params
    }

    /*
     * Update the URL to match params
     */
    const updateUrl = (params) => {
      if (typeof params === 'undefined') return
      params = params.toString() ? ('?' + params.toString()) : ''
      const { pathname, hash } = window.location
      const uri = pathname + params + hash
      window.history.replaceState(uri, '', uri)
    }

    const togglePanel = (clicked) => {
      if (clicked.nodeName.toUpperCase() === 'A') {
        clicked = clicked.parentElement
      }
      if (!clicked.classList.contains('panel-tab')) return
      if (clicked.classList.contains('panel-tab-active')) return

      const tabs = clicked.parentNode
        .querySelectorAll('.panel-tab')
      const panels = clicked.parentNode.parentNode
        .querySelectorAll('.panel')
      const panelTabClicked = clicked.children[0].getAttribute('aria-controls')
      const panelClicked = clicked.parentNode.parentNode.id

      Array.from(tabs)
        .forEach(t => {
          t.classList.remove('panel-tab-active')
          t.removeAttribute('aria-selected')
        })
      Array.from(panels)
        .forEach(p => {
          const active = p.id === panelTabClicked
          p.classList.toggle('panel-active', active)
          // make inactive panels inaccessible by keyboard navigation
          if (active) {
            p.removeAttribute('tabIndex')
            p.removeAttribute('aria-hidden')
          } else {
            p.setAttribute('tabIndex', -1)
            p.setAttribute('aria-hidden', true)
          }
        })

      clicked.classList.add('panel-tab-active')
      clicked.setAttribute('aria-selected', true)

      // emit window resize event to trick html widgets into fitting to the panel width
      window.dispatchEvent(new Event('resize'))

      // update query string
      const params = updateSearchParams(panelClicked, panelTabClicked)
      updateUrl(params)
    }

    const initPanelSet = (panelset, idx) => {
      let panels = Array.from(panelset.querySelectorAll('.panel'))
      if (!panels.length && panelset.matches('.section[class*="level"]')) {
        // we're in tabset-alike R Markdown
        const panelsetLevel = [...panelset.classList]
          .filter(s => s.match(/^level/))[0]
          .replace('level', '')

        // move children that aren't inside a section up above the panelset
        Array.from(panelset.children).forEach(function (el) {
          if (el.matches('div.section[class*="level"]')) return
          panelset.parentElement.insertBefore(el, panelset)
        })

        // panels are all .sections with .level<panelsetLevel + 1>
        const panelLevel = +panelsetLevel + 1
        panels = Array.from(panelset.querySelectorAll(`.section.level${panelLevel}`))
      }

      if (!panels.length) return

      const contents = panels.map(processPanelItem).filter(o => o !== null)
      const newPanelSet = reflowPanelSet(contents, idx)
      newPanelSet.classList = panelset.classList
      panelset.parentNode.insertBefore(newPanelSet, panelset)
      panelset.parentNode.removeChild(panelset)

      // click and touch events
      const panelTabs = newPanelSet.querySelector('.panel-tabs');
      ['click', 'touchend'].forEach(eventType => {
        panelTabs.addEventListener(eventType, function (ev) {
          togglePanel(ev.target)
          ev.stopPropagation()
        })
      })
      panelTabs.addEventListener('touchmove', function (ev) {
        ev.preventDefault()
      })

      // key events
      newPanelSet
        .querySelector('.panel-tabs')
        .addEventListener('keydown', (ev) => {
          const self = ev.currentTarget.querySelector('.panel-tab-active')
          if (ev.code === 'Space' || ev.code === 'Enter') {
            togglePanel(ev.target)
            ev.stopPropagation()
          } else if (ev.code === 'ArrowLeft' && self.previousSibling) {
            togglePanel(self.previousSibling)
            self.previousSibling.focus()
            ev.stopPropagation()
          } else if (ev.code === 'ArrowRight' && self.nextSibling) {
            togglePanel(self.nextSibling)
            self.nextSibling.focus()
            ev.stopPropagation()
          }
        })

      return panels
    }

    // initialize panels
    Array.from(document.querySelectorAll('.panelset')).map(initPanelSet)

    if (typeof slideshow !== 'undefined') {
      const getVisibleActivePanelInfo = () => {
        const slidePanels = document.querySelectorAll('.remark-visible .panel-tab-active')

        if (!slidePanels.length) return null

        return slidePanels.map(panel => {
          return {
            panel,
            panelId: panel.children[0].getAttribute('aria-controls'),
            panelSetId: panel.parentNode.parentNode.id
          }
        })
      }

      slideshow.on('hideSlide', slide => {
        // clear focus if we had a panel-tab selected
        document.activeElement.blur()

        // clear search query for panelsets in current slide
        const params = [...document.querySelectorAll('.remark-visible .panelset')]
          .reduce(function (params, panelset) {
            return updateSearchParams(panelset.id, null, params)
          }, new URLSearchParams(window.location.search))

        updateUrl(params)
      })

      slideshow.on('afterShowSlide', slide => {
        const slidePanels = getVisibleActivePanelInfo()

        if (slidePanels) {
          // only first panel gets focus
          slidePanels[0].panel.focus()
          // but still update the url to reflect all active panels
          const params = slidePanels.reduce(
            function (params, { panelId, panelSetId }) {
              return updateSearchParams(panelSetId, panelId, params)
            },
            new URLSearchParams(window.location.search)
          )
          updateUrl(params)
        }
      })
    }
  })
})()
</script>

    <script>/* global slideshow,Freezeframe */
document.addEventListener('DOMContentLoaded', function () {
  const optsEl = document.getElementById('xaringanExtra-freezeframe-options')
  const opts = optsEl
    ? JSON.parse(optsEl.innerText)
    : { selector: 'img[src$="gif"]', trigger: 'click', responsive: true }

  if (typeof slideshow !== 'undefined') {
    const slides = Array.from(document.querySelectorAll('.remark-slide-container'))
    const getCurrentSlideIndex = () => slides.findIndex(s => s.matches('.remark-visible'))

    window.xeFreezeframe = slides.map(function (slide) {
      const optsSlide = Object.assign({}, opts)
      optsSlide.selector = slide.querySelectorAll(opts.selector)
      return new Freezeframe(optsSlide)
    })

    slideshow.on('afterShowSlide', function () {
      window.xeFreezeframe.forEach((ff, idx) => {
        idx == getCurrentSlideIndex() ? ff.start() : ff.stop()
      })
    })
  } else {
    window.xeFreezeframe = new Freezeframe(opts)
  }
})
</script>

overflow-y: scroll;
}
.scroll-box-14 {
height:14em;
overflow-y: scroll;
}
.scroll-box-16 {
height:16em;
overflow-y: scroll;
}
.scroll-box-18 {
height:18em;
overflow-y: scroll;
}
.scroll-box-20 {
height:20em;
overflow-y: scroll;
}
.scroll-output {
height: 90%;
overflow-y: scroll;
}

.remark-inline-code{
background: #f2f2f2;

border-radius: 3px;
padding: 4px;
}

.hljs-github .hljs {
background: #f2f2f2;
}

.content-box {
box-sizing: border-box;
background-color: #e2e2e2;
}
.content-box-blue,
.content-box-gray,
.content-box-grey,
.content-box-army,
.content-box-orange,
.content-box-green,
.content-box-purple,
.content-box-red,
.content-box-yellow {
box-sizing: border-box;
border-radius: 15px;
margin: 0 0 15px;
overflow: hidden;
padding: 0px 20px 0px 20px;
width: 100%;
}
.content-box-blue { background-color: #F0F8FF; }
.content-box-gray { background-color: #e2e2e2; }
.content-box-grey {	background-color: #e8e8e8;color: #636363; }
.content-box-army {	background-color: #737a36; }
.content-box-green { background-color: #d9edc2; }
.content-box-orange { background-color: #ffcba3; }
.content-box-red { background-color: #ffcccc; }
.content-box-yellow { background-color: #fef5c4; }
.content-box-blue .remark-inline-code,
.content-box-blue .remark-inline-code,
.content-box-gray .remark-inline-code,
.content-box-grey .remark-inline-code,
.content-box-army .remark-inline-code,
.content-box-green .remark-inline-code,
.content-box-purple .remark-inline-code,
.content-box-red .remark-inline-code,
.content-box-yellow .remark-inline-code {
background: none;
}
.full-width {
display: flex;
width: 100%;
flex: 1 1 auto;
}

.opacity{ opacity: 0.5; }
.blur {
-webkit-filter: blur(5px);
-moz-filter: blur(10px);
-o-filter: blur(5px);
-ms-filter: blur(5px);
filter: blur(5px);
}
.grayscale img {
-webkit-filter: grayscale(100%); 
filter: grayscale(100%);
}

.rotate-left {
-webkit-transform: rotate(-2deg);
-moz-transform: rotate(-2deg);
transform: rotate(-2deg);
}
.rotate-right {
-webkit-transform: rotate(2deg);
-moz-transform: rotate(2deg);
transform: rotate(2deg);
}

.polaroid img {
border: 10px solid #fff;
border-bottom: 45px solid #fff;
-webkit-box-shadow: 3px 3px 3px #111;
-moz-box-shadow: 3px 3px 3px #111;
box-shadow: 3px 3px 3px #111;
}
.shadow {
-moz-border-radius: 5px;
-moz-box-shadow: 5px 5px 5px #aaa;
-webkit-box-shadow: 5px 5px 5px #aaa;
box-shadow: 5px 5px 5px #aaa;
border-radius: 2px;
}

@page { margin: 0; }
@media print {
.inverse, .segue, .segue-yellow, .segue-red, .sydney-blue,
.sydney-yellow, .sydney-red {
background-color: transparent;
color: black;
text-shadow: none;
}
.inverse h1, .inverse h2, .inverse h3, .inverse h4, .inverse h5, .segue {
background-color: transparent;
color: black;
text-shadow: none;
}
.eg {
background-color: transparent;
}
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}

# Motivation

.pull-left[

&lt;/br&gt;

- Understanding European Allowances (EUA) dynamics is important
for several fields:
- - Portfolio &amp; Risk Management,
- - Sustainability Planing
- - Political decisions
- - ...

EUA prices are obviously connected to the energy market

How can the dynamics be characterized?

]

.pull-right[

&lt;/br&gt;

- Several Questions arise:

- - Data (Pre)processing
- - Modeling Approach
- - Evaluation

]

???

On their own, EUA prices are ’just’ a random walk.
The first differences are stationary and heteroscedastic.
Autoregressive Volatility modeling (ARCH, GARCH, . . .) is sensible!

---
  
# Data

- EUA, natural gas, Brent crude oil, coal 
- March 15, 2010, until October 14, 2022

- Data was normalized w.r.t. `\(\text{CO}_2\)` emissions
- Emission-adjusted prices reflects one tonne of `\(\text{CO}_2\)`

- We adjusted for inflation by Eurostat&#39;s HICP, excluding energy


- Log transformation of the data to stabilize the variance

- ADF Test: All series are stationary in first differences

- Johansen’s likelihood ratio trace test suggests two cointegrating relationships (levels)
- Johansen’s likelihood ratio trace test suggests no cointegrating relationships (logs)

# Modeling Approach: Overview

&lt;/br&gt;

#### VECM: Vector Error Correction Model
  - Modeling the expectaion
  - Captures the long-run cointegrating relationship
  - Different cointegrating ranks, including rank zero (no cointegration)

#### GARCH: Generalized Autoregressive Conditional Heteroscedasticity
  - Captures the variance dynamics

#### Copula: Captures the dependence structure
  - Captures: conditional cross-sectional dependence structure
  - Dependence allowed to vary over time

---

# Modeling Approach: Overview

.pull-left[

- Let `\(\boldsymbol{X}_t\)` be a `\(K\)`-dimensional vector at time `\(t\)`
- The forecasting target:
  - Conditional joint distribution 
  - `\(F_{\boldsymbol{X}_t|\mathcal{F}_{t-1}}\)` 
  - `\(\mathcal{F}_{t}\)` is the sigma field generated by all information available up to and including time `\(t\)`

Sklars theorem: decompose target into 
  - marginal distributions: `\(F_{X_{k,t}|\mathcal{F}_{t-1}}\)` for `\(k=1,\ldots, K\)`, and
  - copula function: `\(C_{\boldsymbol{U}_{t}|\mathcal{F}_{t - 1}}\)`

]

.pull-right[

Let  `\(\boldsymbol{x}_t= (x_{1,t},\ldots, x_{K,t})^\intercal\)` be the realized values

It holds that:

`\begin{align}
    F_{\boldsymbol{X}_t|\mathcal{F}_{t-1}}(\boldsymbol{x}_t) = C_{\boldsymbol{U}_{t}|\mathcal{F}_{t - 1}}(\boldsymbol{u}_t) \nonumber
\end{align}`

with: `\(\boldsymbol{u}_t =(u_{1,t},\ldots, u_{K,t})^\intercal\)`,  `\(u_{k,t} = F_{X_{k,t}|\mathcal{F}_{t-1}}(x_{k,t})\)`

For brewity we drop the conditioning on `\(\mathcal{F}_{t-1}\)`.

The model can be specified as follows

`\begin{align}
    F(\boldsymbol{x}_t) = C \left[\mathbf{F}(\boldsymbol{x}_t; \boldsymbol{\mu}_t, \boldsymbol{ \sigma }_{t}^2, \boldsymbol{\nu}, \boldsymbol{\lambda}); \Xi_t, \Theta\right] \nonumber
\end{align}`

`\(\Xi_{t}\)` denotes time-varying dependence parameters
`\(\Theta\)` denotes time-invariant dependence parameters

We take `\(C\)` as the `\(t\)`-copula

]

---

# Modeling Approach: Mean and Variance

.pull-left[

#### Individual marginal distributions: 

`$$\mathbf{F} = (F_1, \ldots, F_K)^{\intercal}$$`

#### Generalized non-central t-distributions
  - To account for heavy tails
  - Time varying
    - expectation: `\(\boldsymbol{\mu}_t = (\mu_{1,t}, \ldots, \mu_{K,t})^{\intercal}\)`
    - variance: `\(\boldsymbol{\sigma}_{t}^2 = (\sigma_{1,t}^2, \ldots, \sigma_{K,t}^2)^{\intercal}\)`
  - Time invariant 
    - degrees of freedom: `\(\boldsymbol{\nu} = (\nu_1, \ldots, \nu_K)^{\intercal}\)`
    - noncentrality: `\(\boldsymbol{\lambda} = (\lambda_1, \ldots, \lambda_K)^{\intercal}\)`

]

.pull-right[

#### VECM Model

`\begin{align}
    \Delta \boldsymbol{\mu}_t = \Pi \boldsymbol{x}_{t-1} + \Gamma \Delta \boldsymbol{x}_{t-1} \nonumber
\end{align}`

where `\(\Pi = \alpha \beta^{\intercal}\)`  is the cointegrating matrix of rank `\(r\)`, `\(0 \leq r\leq K\)`.

#### GARCH model

`\begin{align}
    \sigma_{i,t}^2 = &amp; \omega_i + \alpha^+_{i} (\epsilon_{i,t-1}^+)^2 + \alpha^-_{i} (\epsilon_{i,t-1}^-)^2 + \beta_i \sigma_{i,t-1}^2 \nonumber
\end{align}`

where `\(\epsilon_{i,t-1}^+ = \max\{\epsilon_{i,t-1}, 0\}\)` ...

Separate coefficients for positive and negative innovations to capture leverage effects.

]

---

# Modeling Approach: Dependence

.pull-left[

#### Time-varying dependence parameters

`\begin{align*}
    \Xi_{t} = &amp; \Lambda\left(\boldsymbol{\xi}_{t}\right)
    \\
    \xi_{ij,t} = &amp; \eta_{0,ij} + \eta_{1,ij} \xi_{ij,t-1} + \eta_{2,ij} z_{i,t-1} z_{j,t-1},
\end{align*}`

`\(\xi_{ij,t}\)` is a latent process 


`\(z_{i,t}\)` denotes the `\(i\)`-th standardized residual from time series `\(i\)` at time point `\(t\)`


`\(\Lambda(\cdot)\)` is a link function
- ensures that `\(\Xi_{t}\)` is a valid variance covariance matrix
- ensures that `\(\Xi_{t}\)` does not exceed its support space and remains semi-positive definite
]

.pull-right[

#### Maximum Likelihood Estimation

All parameters can be estimated jointly. Using conditional independence:
`\begin{align*}
    L = f_{X_1} \prod_{i=2}^T f_{X_i|\mathcal{F}_{i-1}},
\end{align*}`
with multivariate conditional density:
`\begin{align*}
    f_{\mathbf{X}_t}(\mathbf{x}_t | \mathcal{F}_{t-1}) = c\left[\mathbf{F}(\mathbf{x}_t;\boldsymbol{\mu}_t, \boldsymbol{\sigma}_{t}^2, \boldsymbol{\nu},
    \boldsymbol{\lambda});\Xi_t, \Theta\right] \cdot \\ \prod_{i=1}^K f_{X_{i,t}}(\mathbf{x}_t;\boldsymbol{\mu}_t, \boldsymbol{\sigma}_{t}^2, \boldsymbol{\nu}, \boldsymbol{\lambda})
\end{align*}`
The copula density `\(c\)` can be derived analytically.


]

---

# Study Design and Evaluation

.pull-left[

#### Rolling-window forecasting study 

- 3257 observations total
- Window size: 1000 days (~ four years)
- Forecasting 30-steps-ahead

=&gt; 2227 potential starting points 

We sample 250 to reduce computational cost

We draw `\(2^{12}= 2048\)` trajectories from the joint predictive distribution 

]

.pull-left[

#### Evaluation

Forecasts are evaluated by the energy score (ES)

`\begin{align*}
    \text{ES}_t(F, \mathbf{x}_t) = \mathbb{E}_{F} \left(||\tilde{\mathbf{X}}_t - \mathbf{x}_t||_2\right) - \frac{1}{2} \mathbb{E}_F \left(||\tilde{\mathbf{X}}_t - \tilde{\mathbf{X}}_t&#39;||_2 \right)
\end{align*}`

where `\(\mathbf{x}_t\)` is the observed `\(K\)`-dimensional realization and `\(\tilde{\mathbf{X}}_t\)`, respectively `\(\tilde{\mathbf{X}}_t&#39;\)` are independent random vectors distributed according to `\(F\)`

For univariate cases the Energy Score becomes the Continuous Ranked Probability Score (CRPS)

]

.pull-right[

- Benchmarks:
  - `\(\text{RW}^{\sigma, \rho}\)`: Random walk with constant volatility and correlation
  - Univariate `\(\text{ETS}^{\sigma}\)` with constant volatility
  - Vector ETS `\(VES^{\sigma}\)` with constant volatility 

- Heteroscedasticity is a main driver of ES
- The VECM model without cointegration (essentially a VAR) is the best performing model in terms of ES overall
- For EUA, the ETS Benchmark is the best performing model in terms of ES

]

# CRPS Scores

.pull-left-3[

- CRPS solely evaluates the marginal distributions
  - The cross-sectional dependence is ignored


- VES models deliver poor performance in short horizons
- For Oil prices the RW Benchmark can&#39;t be oupterformed 30 steps ahead
- Both VECM models generally deliver good performance 

]

# Conclusion

.pull-left[

Accounting for heteroscedasticity or stabilizing the variance via log transformation is crucial for good performance in terms of ES

- Price dynamics emerged way before the russian invaion into ukraine
- Linear dependence between the series reacted only right after the invasion 
- Improvements in forecasting performance is mainly attributed to:
  -  the tails multivariate probabilistic predictive distribution
  -  the dependence structure between the marginals

]

var ZOOM_IMG_RULE;

var zoom_factor = 100.0;
document.body.style.zoom = "100%"


function init_zoom_rule() {
    // @see http://davidwalsh.name/add-rules-stylesheets
    var styles = document.styleSheets[0];
    var index = styles.insertRule(
        ZOOM_IMG_SELECTOR + ' { transform:scale(1); }',
        styles.cssRules.length
        );

    ZOOM_IMG_RULE = styles.cssRules.item(index);
}


function apply_zoom() {
    var elements = document.querySelectorAll(ZOOM_TEXT_SELECTOR);
    //console.log('length:', elements.length);
    for (var i = 0; i < elements.length; ++i) {
        var item = elements[i];
        item.style.fontSize = zoom_factor.toString() + '%';
    }

    ZOOM_IMG_RULE.style.transform = 'scale(' + (zoom_factor / 100) + ')';
}

function zoom_in() {
    zoom_factor += 10;
    if (zoom_factor >= 200.0)  zoom_factor = 200.0;
    apply_zoom();
}

function zoom_out() {
    zoom_factor -= 10;
    if (zoom_factor <= 50.0)  zoom_factor = 50.0;
    apply_zoom();
}

function zoom_reset() {
    zoom_factor = 100.0;
    apply_zoom();
}
